(function() {
  var Doc;

  module.exports = Doc = (function() {
    function Doc(originalText) {
      this.originalText = originalText;
      this.visibility = 'Private';
    }

    Doc.prototype.isPublic = function() {
      return /public|essential|extended/i.test(this.visibility);
    };

    Doc.prototype.isInternal = function() {
      return /internal/i.test(this.visibility);
    };

    Doc.prototype.isPrivate = function() {
      return !this.isPublic() && !this.isInternal();
    };

    Doc.prototype.setReturnValues = function(returnValues) {
      if (this.returnValues != null) {
        return this.returnValues = this.returnValues.concat(returnValues);
      } else {
        return this.returnValues = returnValues;
      }
    };

    return Doc;

  })();

}).call(this);
